import React from "react";
import { Header, List, Rating } from "semantic-ui-react";

const Books = ({ books }) => {
  return (
    <List>
      {books.map((book) => {
        return (
          <List.Item key={book.name}>
            <Header>{book.name}</Header>
            <Rating icon="star" defaultRating={3} maxRating={5} />
          </List.Item>
        );
      })}
    </List>
  );
};

export default Books;
